<?php 

//registering addon
require_once plugin_dir_path( __FILE__  ) . 'api.php';


add_filter('gutenberg_forms_integrations', function($integrations) {

    $mailChimp = new MailChimp();
    $guide = plugin_dir_path( __FILE__ ) . 'guide/guide.html';

    $available_lists = $mailChimp->get_lists();

    $arguments = array(
        'title' => 'Mail Chimp',
        'is_pro'  => true,
        'type'  => 'autoResponder',
        'guide' => file_get_contents( $guide ),
        'description' => 'Mailchimp Addon for Gutenberg Forms lets you connect Mailchimp with your form. You can send leads to any of your lists in Mailchimp when a user submits the form.',
        'banner' => 'data:image/png;base64,',
        'fields' => array(
            'api_key' =>  array(
                'label' => 'Api Key',
                'default' => '',
                'type' => 'string',
            )
        ),
        'query_fields' => array(
            'list' => array(
                'label' => 'Select List',
                'value' => $available_lists,
                'type'  => 'select'
            ),
            'tags' => array(
                'label' => 'Tags',
                'type'  => 'tags',
                'value' => []
            )
        ),
        'api_fields' => array(
            'EMAIL' => array(
                'label' => 'Email'
            ),
            'FNAME' => array(
                'label' => 'First Name'
            ),
            'LNAME' => array(
                'label' => 'Last Name'
            ),
            'PHONE' => array(
                'label' => 'Phone'
            ),
            'ADDRESS_1' => array(
                'label' => 'Address 1'
            ),
            'STATE' => array(
                'label' => 'State'
            ),
            'ZIP' => array(
                'label' => 'Zip Code'
            ),
            'COUNTRY' => array(
                'label' => 'Country'
            ),
            'CITY'  => array(
                'label' => 'City'
            )
        )
    ); 

    $integrations['mailchimp'] = $arguments;

    return $integrations;

});


add_action('gutenberg_forms_submission__mailchimp', function($entry) {

    $mailChimp = new MailChimp();

    $mailChimp->post( $entry );

});